import React, { useEffect, useState } from 'react';
import StoreButtons from './components/StoreButtons';

export default function App() {
  const [links, setLinks] = useState(null);

  useEffect(() => {
    fetch('/api/app-links').then(r=>r.json()).then(setLinks);
  }, []);

  return (
    <div>
      <h1>FilmConnect</h1>
      {links ? <StoreButtons googlePlay={links.googlePlay} appStore={links.appStore}/> : "Loading..."}
    </div>
  );
}
